import React from "react";
import BootstrapTable from "react-bootstrap-table-next";
import paginationFactory from "react-bootstrap-table2-paginator";
import {headerSortingClasses, sortCaret} from "../../../../../../_metronic/_helpers";


export function TradePriceList(props) {
    const columns = [
        {
            dataField: "effective_date",
            text: "Effective Date",
            sort: true,
            sortCaret: sortCaret,
            headerSortingClasses,
            formatter: (cellContent, row) => (<span>{row.effective_date}</span>)
        },
        {
            dataField: "expired_date",
            text: "Expired Date",
            sort: true,
            classes: "text-center",
            headerClasses: "text-center",
            sortCaret: sortCaret,
            headerSortingClasses,
            formatter: (cellContent, row) => (<span>{row.expired_date}</span>)
        },
        {
            dataField: "amount",
            text: "Amount",
            sort: true,
            classes: "text-right",
            headerClasses: "text-right",
            sortCaret: sortCaret,
            headerSortingClasses,
            formatter: (cellContent, row) => (<strong>{row.amount}</strong>)
        },
    ];

    return (
        <>
            <BootstrapTable
                wrapperClasses="table-responsive"
                classes="table table-head-custom table-vertical-center overflow-hidden"
                bootstrap4
                bordered={false}
                keyField="id"
                data={props.tradePriceList}
                columns={columns}
                sort={{dataField: 'effective_date', order: 'desc'}}
                pagination={paginationFactory({sizePerPage: 10, showTotal: true})}
            />
        </>
    );
}
